import React, { Component } from 'react'
import RegisterComponent from "./RegisterComponent"

/*
const MainPage = ({userDetail}) => {
  return(
    <div className="container">
      <h1>It's alive!</h1>
      <p>Your account: {userDetail.account}</p>
      <p>Your balance: {userDetail.balance} ETH</p>
      <RegisterComponent userDetail={userDetail}/>
    </div>
  )
}*/
class MainPage extends Component{
  constructor(props){
    super();
    this.state={
      newUser: false
    }
  }
  togglePop = () => {
    this.setState({
      newUser: !this.state.newUser
    });
  };
  checkExistingUser(){
    this.props.userDetail.contract.methods.isUserExists(this.props.userDetail.account).call()
  }
  render(){
    return(
      <div className="container">
        <h1>It's alive!</h1>
        <p>Your account: {this.props.userDetail.account}</p>
        <p>Your balance: {this.props.userDetail.balance} ETH</p>
        {this.state.newUser ? <RegisterComponent userDetail={this.props.userDetail}/> : null}
      </div>
    );
  }
}

export default MainPage
